def translate_layout_keys(t):
    xr, yr = t
    xr = xr.replace('axis', '')
    yr = yr.replace('axis', '')
    return xr, yr


def get_non_empty_subplots(fig, selector):
    non_empty_subplots = []
    for xaxis in fig.layout:
        if 'xaxis' in xaxis:
            for yaxis in fig.layout:
                if 'yaxis' in yaxis:
                    subplot_key = translate_layout_keys((xaxis, yaxis))
                    if selector(subplot_key):
                        non_empty_subplots.append(subplot_key)
    return non_empty_subplots

